            var unquotedJson = GetWikiJson();

            var quotedJson = new Regex("([a-zA-Z0-9_$]+?): (.*?)[,]{0,1}").Replace(unquotedJson, "\"$1\": ");

            //var nestedQuotedJson = string.Format("{{{0}}}", quotedJson);

            return (quotedJson);
        }

